import React from "react";

function Navbar() {
  return (
    <div className="navbar bg-gray-300 flex justify-between items-center p-4 shadow-lg">
      <h1 className="logo text-xl font-bold">Pitch Crest</h1>
      <ul className="links flex space-x-4">
        <li><a href="#home" className="text-blue-500">Home</a></li>
        <li><a href="#about" className="text-blue-500">About Us</a></li>
        <li><a href="contact" className="text-blue-500">Contact</a></li>
        <li><a href="signup" className="text-blue-500">Sign up</a></li>
        <li><a href="login" className="text-blue-500">Login</a></li>
      </ul>
    </div>
  );
}

export default Navbar;
